import React from "react";

// Define the System interface to represent a system object
interface System {
  _id: string;
  type: string;
  workflowItems?: string[]; // Array of workflow items (for workflow systems)
  vendorType?: string; // Vendor type (for vendor solutions)
  vendorName?: string; // Vendor name (for vendor solutions)
  year?: number; // Year (for vehicles)
  make?: string; // Make (for vehicles)
  model?: string; // Model (for vehicles)
}

// Props for the SystemTable component
interface SystemTableProps {
  systems: System[]; // Array of systems to display in each table
  onDeleteSystem: (systemId: string) => void; // Function for deleting a system
  onEditSystem: (systemId: string) => void; // Function for editing a system
}

// Table for Workflow systems
const WorkflowTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  return (
    <>
      <h3 className="text-xl font-semibold mb-4">Workflows</h3>
      <table className="min-w-full table-auto bg-white shadow-lg">
        <thead>
          <tr>
            <th className="px-4 py-2">Workflow Items</th>
            <th className="px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {systems
            .filter((system) => system.type === "workflow")
            .map((system) => (
              <tr key={system._id}>
                <td className="border px-4 py-2">
                  <ul>
                    {system.workflowItems?.map((item, index) => (
                      <li key={index}>{item}</li>
                    ))}
                  </ul>
                </td>
                <td className="border px-4 py-2">
                  <button
                    onClick={() => onEditSystem(system._id)}
                    className="bg-yellow-500 text-white px-4 py-1 rounded mr-2 hover:bg-yellow-600"
                  >
                    Edit
                  </button>
                  <button
                    onClick={() => onDeleteSystem(system._id)}
                    className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
        </tbody>
      </table>
    </>
  );
};

// Table for Vendor Solution systems
const VendorSolutionTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  return (
    <>
      <h3 className="text-xl font-semibold mb-4">Vendor Solutions</h3>
      <table className="min-w-full table-auto bg-white shadow-lg">
        <thead>
          <tr>
            <th className="px-4 py-2">Vendor Name</th>
            <th className="px-4 py-2">Vendor Type</th>
            <th className="px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {systems
            .filter((system) => system.type === "vendorSolution")
            .map((system) => (
              <tr key={system._id}>
                <td className="border px-4 py-2">{system.vendorName}</td>
                <td className="border px-4 py-2">{system.vendorType}</td>
                <td className="border px-4 py-2">
                  <button
                    onClick={() => onEditSystem(system._id)}
                    className="bg-yellow-500 text-white px-4 py-1 rounded mr-2 hover:bg-yellow-600"
                  >
                    Edit
                  </button>
                  <button
                    onClick={() => onDeleteSystem(system._id)}
                    className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
        </tbody>
      </table>
    </>
  );
};

// Table for Vehicle systems
const VehicleTable: React.FC<SystemTableProps> = ({
  systems,
  onDeleteSystem,
  onEditSystem,
}) => {
  return (
    <>
      <h3 className="text-xl font-semibold mb-4">Vehicles</h3>
      <table className="min-w-full table-auto bg-white shadow-lg">
        <thead>
          <tr>
            <th className="px-4 py-2">Year</th>
            <th className="px-4 py-2">Make</th>
            <th className="px-4 py-2">Model</th>
            <th className="px-4 py-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {systems
            .filter((system) => system.type === "vehicle")
            .map((system) => (
              <tr key={system._id}>
                <td className="border px-4 py-2">{system.year}</td>
                <td className="border px-4 py-2">{system.make}</td>
                <td className="border px-4 py-2">{system.model}</td>
                <td className="border px-4 py-2">
                  <button
                    onClick={() => onEditSystem(system._id)}
                    className="bg-yellow-500 text-white px-4 py-1 rounded mr-2 hover:bg-yellow-600"
                  >
                    Edit
                  </button>
                  <button
                    onClick={() => onDeleteSystem(system._id)}
                    className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
        </tbody>
      </table>
    </>
  );
};

// Export all three tables in one component
const SystemTable: React.FC<SystemTableProps> = (props) => {
  return (
    <div className="space-y-8">
      <WorkflowTable {...props} /> {/* Render workflow systems table */}
      <VendorSolutionTable {...props} />{" "}
      {/* Render vendor solution systems table */}
      <VehicleTable {...props} /> {/* Render vehicle systems table */}
    </div>
  );
};

export default SystemTable;
